package com.zfsoft.superwindow.controller.easyquickcase.data;

import io.swagger.annotations.ApiModel;
import io.swagger.annotations.ApiModelProperty;
import lombok.Data;

@Data
@ApiModel(description = "身份证信息 ")
public class ReqPersonDto {

    /**
     * @COLUMN_EXPLAIN : 用户名称
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "用户名称",required = true,example = "王大锤")
    private String name;

    /**
     * @COLUMN_EXPLAIN : 性别
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "性别",required = true,example = "男")
    private String sex;

    /**
     * @COLUMN_EXPLAIN : 民族
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "民族",required = true,example = "汉")
    private String nation;

    /**
     * @COLUMN_EXPLAIN : 用户出生年月
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "用户出生年月",required = true,example = "19921129")
    private String birthday;

    /**
     * @COLUMN_EXPLAIN : 用户身份证号码
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "用户身份证号码",required = true,example = "421182199211294513")
    private String number;

    /**
     * @COLUMN_EXPLAIN : 用户住址
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "用户住址",required = true,example = "湖北省武穴市梅川镇岳山村国基洼垸5号")
    private String address;

    /**
     * @COLUMN_EXPLAIN : 签发机关
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "签发机关",required = true,example = "武穴市公安局")
    private String department;

    /**
     * @COLUMN_EXPLAIN : 有效期限
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "有效期限",required = true,example = "20120312-20220312")
    private String timeLimit;

    /**
     * @COLUMN_EXPLAIN : 身份证头像图片base64
     * @TABLE_COLUMN_TYPE : varchar
     */
    @ApiModelProperty(value = "身份证头像图片base64",required = true,example = "")
    private String Image;

    @ApiModelProperty(value = "分数",example = "10")
    private Integer resultScore;
}
